what’s done is done!  mid term elections today! 
my vote has been cast! 😋

go big blue!  #vote2018 
don’t assume you should leave if a polling place is about to close.  if you are in line when the hours of operation close, they are required to stay open and allow you to vote — so do not get out of line,” even if you are told otherwise. .

polling locations experiencing issues?
call 866-our-vote! 
call 866-our-vote or text our vote to 97779 if you are facing issues during voting.
.
.
