text:
{the hermit}
my heart is broken, but it is resilient. when my friends desert me because they do not like my commitment to my own truth, it makes me stronger, because i am learning to look after myself. when my own family takes a family bonding trip to puerto rico together without inviting me, or even speaking to me enough to ask if i am okay or need support and leaves it up to me finding out from various social media pictures, it hurts. but it teaches me that i am doing the right thing by not allowing them into my life to abuse me further, that i deserve to protect myself. it teaches me that what i had felt, that i have never been safe with those who continually told me "they would always love me" without listening to a single thing i said and claiming to be my family was valid. that i am valid, and the world is fucked. i will continue drawing on my power and my real family who loves me enough to support me when i really need it. you are my family, now. you and the forest, and my partner who loves me so much through all of this. i am so grateful for you.

i am strong, but i am nursing and tending to some pretty serious wounds. i will be taking a social media break for my own mentality, but please don't go anywhere! prc has released an official statement (by hiding it on the bottom of the comments page and not sending it to me) on how "if they would have known" things would be happening differently. this is victim blaming. they have still not offered me any support despite their ludicrous statement that they feel bad that i'm "hurting." this is performative, and still there is no trauma education on campus. they also accused me of leveling "threats" at the prc community which is the very community i am trying to protect. telling the dean of students that "you owe me" for personally encouraging me to work with sean, not commenting when we spent way too  much time together and protecting an institution rather than his students is not a threat. it's a fact. i will be releasing this letter and a link for a go fund me campaign to raise expenses for a legal battle when i arrive back. in the meantime keep pressuring prc. send emails. complain about the letter. (cont.👇)

